import React from 'react';
const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
        <h2>Hello World</h2>
        <h3>Hello World</h3>
        <hr/>
        <code>
          const a = 'b'
        </code>
      </header>
    </div>
  );
}

export default App;
